import { ReactMarkdown } from "react-markdown/lib/react-markdown";
import remarkGfm from "remark-gfm";
import "./App.css";
import posts from "../assets/posts.json";

const loadData = () => JSON.parse(JSON.stringify(posts));
const postList = loadData;
const currentPost = postList.title;
const postContentString = currentPost.title;

function Post() {
  return; // eslint-disable-next-line
  // <ReactMarkdown children={postContentString} remarkPlugins={[remarkGfm]} />;
  <ReactMarkdown source={postContentString} />;
}

export default Post;
